m.Parking – už automobilio stovėjimą mokėkite greičiau ir patogiau!




Naudojantis programėle m.Parking galima atsiskaityti už Vilniaus, Kauno, Klaipėdos ir Trakų miestų savivaldybių tarybų nustatytas mokamas automobilių stovėjimo vietas gatvėse ir aikštelėse, kuriose renkama vietinė rinkliava ir uždarose aikštelėse Vilniuje: Gedimino pr. 9A, Tilto g. 14, T. Kosciuškos g. 1A, G. Baravyko g. 3, G. Baravyko g. 10 , Šeimyniškių g. 23, Antakalnio g. 59.


Paprasta naudoti:
- nereikia išankstinės registracijos, užtenka parsisiųsti ir įsidiegti nemokamą m.Parking programėlę išmaniajame įrenginyje;
- programėlė fiksuoja tikslų automobilio stovėjimo pradžios ir pabaigos laiką. Jeigu stovėjimas užsakomas, kai pasirinktoje rinkliavos zonoje mokamas stovėjimo laikas dar neprasidėjęs, jis aktyvuojasi prasidėjus mokamam stovėjimo laikui;
- stovėjimo užsakymas vykdomas vos tik pastačius automobilį, vairuotojui nuo jo neatsitraukus;
- pranešimas apie automobilio stovėjimo pabaigos laiką siunčiamas vairuotojui įlipus į automobilį, prieš išvažiuojant.


Mokėjimo būdai:
m.Parking yra galimybė atsiskaityti banko kortele arba per savo mobilaus ryšio operatorių. Apmokant už automobilio stovėjimą banko kortele, nėra taikomas paslaugos užsakymo mokestis, tuo tarpu apmokant per mobiliojo ryšio operatorių, operatorius taiko papildomą paslaugos užsakymo mokestį. Daugiau informacijos apie šį paslaugos mokestį Telia, Bitė, Tele2. Atsiskaityti m.Parking banko kortele kol kas galima tik Vilniuje. 


Programėlės privalumai:
- nereikia turėti grynųjų pinigų ir ieškoti artimiausio parkomato;
- mokėjimas skaičiuojamas pagal faktiškai stovėtą laiką;
- galimybė nustatyti automatinį automobilio stovėjimo laiko sustabdymą norimu laiku;
- galimybė gauti SMS priminimą apie paslaugos užsakymo pabaigą;
- galimybė vienam vartotojui m.Parking programėlėje pridėti kelias transporto priemones ir už jas apmokėti.


Aktuali informacija:
- automobilio vairuotojas (valdytojas), mokėdamas vietinę rinkliavą, turi vadovautis kelio ženklais ir informacinėmis lentelėmis;
- automobilio vairuotojas (valdytojas) atsako už tinkamą mokėjimo, vietinės rinkliavos zonos, mokamo laiko parinkimą, automobilio valstybinio numerio įvedimą ir kitus įvedamus ir pasirenkamus duomenis;
- sumokėta vietinė rinkliava neužtikrina stovėjimo vietos ir jos nerezervuoja;
- sumokėta vietinė rinkliava nesuteikia teisės statyti automobilį draudžiamųjų kelio ženklų galiojimo zonoje ar kitaip nesilaikyti Kelių eismo taisyklių.


Jei programėlei nepavyko nustatyti jūsų telefono numerio. Patikrinkite:​
- Ar esate atsijungęs nuo WiFi tinklo (vartotojas autentifikuojamas per operatoriaus ryšį);​
- Ar telefone aktyvuotas duomenų perdavimas;
- Patikrinkite, ar telefone išjungta „Private Relay“ funkcija: Išjungti „Private Relay“ funkciją telefone galite taip: Settings > [jūsų vardas] > iCloud > Private Relay. Atsidariusiame lange „Private Relay“ šliaužiklis turi būti pastumtas į kairę pusę;​

- Jei telefone įjungtas VPN – laikinai jį išjunkite, kol naudojatės programėle.​


