„Ignitis EnergySmart" tai programėlė skirta Ignitis nepriklausomo tiekėjo klientams, turintiems išmanią apskaitą. Programėlės naudotojai gali patogiai ir greitai susipažinti su elektros energijos suvartojimo ir gamybos statistika bei energetinio efektyvumo ir CO₂ mažinimo galimybėmis. „Ignitis EnergySmart" leis:

- Įvertinti praėjusios dienos energijos suvartojimo kiekį lyginant su mažiausiu ir didžiausiu sunaudotu kiekiu per paskutines 30 dienų;
- Analizuoti savaitės, mėnesio bei kelių mėnesių elektros energijos sunaudojimo apimtis;
- Palyginti elektros energijos sunaudojimo ar stoginių saulės elektrinių gamybos apimtis su panašiuose namuose gyvenančių kitų elektros vartotojų energijos sunaudojimu;
- Pateikus keletą atsakymų apie namuose naudojamą įrangą, gauti išsamią analizę apie daugiausiai energijos sunaudojančias buitinių prietaisų kategorijas.
- Pridėti nuosavas nutolusias saulės ar vėjo elektrines ir sekti dienos, savaitės ar mėnesių generacijos apimtis.

